import ContactsForm from './components/ContactsForm.vue';

const routes = [
  {
    name: 'lang?',
    path: "/:lang",
    children: [
      {
        name: 'projects',
        path: "/:lang/projects",
        component: ContactsForm,
        meta: {
         nameRus: "Проекты",
        }
      },
      {
        name: 'about',
        path: "/:lang/about",
        component: ContactsForm,
        meta: {
         nameRus: "О компании",
        }
      },
      {
        name: 'contacts',
        path: "/:lang/contacts",
        component: ContactsForm,
        meta: {
         nameRus: "Контакты",
        }
      },
      {
        path: "*",
        redirect: "/contacts",
      },
    ],
    //component: ContactsForm,
  },

];

export default routes;
